import React from 'react';
import { Jumbotron} from 'reactstrap';

const Header = () => (
    <div className="bg header">
        <Jumbotron>
            <h1>Vasiliki Vourliotaki</h1>
        </Jumbotron>
    </div>
)

   



export default Header;
